INSERT INTO `product` VALUES ('42', '特价8号', '2008', '1', '0', '1', '/uploadFile/product/7a0352bd-a4bc-4be8-aea6-f27eb9ecef06.jpg_/uploadFile/product/25713e0b-1508-4e69-9a4e-25b6775ad0fc.jpg_/uploadFile/product/93c3a34f-c4b8-4727-a9d7-9be9e67ecdfd.jpg_/uploadFile/product/09887ebd-d2d5-4396-bcfe-77c52e569f69.jpg', '/uploadFile/product/7a0352bd-a4bc-4be8-aea6-f27eb9ecef06.jpg', '126', '127', '这次暴雨很大，但的确没有网络谣言所说的那么吓人。方翀告诉记者，此次暴雨北京及其周边地区是影响最大的区域，但是暴雨覆盖华北、黄淮中东部和东北地区南部等地。其中，内蒙古中部偏南地区、河北、北京、天津、辽宁西南部、河南东部、山东、安徽东北部和江苏北部等地的部分地区有大到暴雨，北京西部和北部沿山、河北北部等地的部分地区有大暴雨，局地累积雨量可达120毫米至150毫米。\n\n对于即将来临的降雨过程，专家提醒公众要做好相关防范：强降雨天气将导致低洼地区和部分路段出现道路积水，对22日早、晚城市交通将造成较大影响，同时伴有雷电、短时大风和冰雹等强对流天气，有可能引发城市内涝，应该注意防范。强降雨期间需远离山区、河流、水库、旅游景区和建筑工地等危险地带，需注意防范山区强降雨可能诱发的中小河流洪水、山洪及泥石流、滑坡、崩塌等地质灾害。此外，持续降雨将影响冬小麦的收晒，应该抓紧时间抢收及晾晒。', '1', 'admin', null, '2017-06-23 11:06:20', null, '123.00', null);
