INSERT INTO `product` VALUES ('136', 'LEGO 乐高 稻草人恐怖集中营（9成新无包装）', '1', '0', '0', '1', '/uploadFile/product/201707/05c0ca72-c574-4bff-a26c-1fa3015cf383.jpg', '/uploadFile/product/201707/05c0ca72-c574-4bff-a26c-1fa3015cf383.jpg', '122', '124', 'LEGO 乐高 稻草人恐怖集中营（9成新无包装）： 稻草人恐怖集中营，产品包括5个特殊的人偶：防毒面具款蝙蝠侠、蓝甲虫、稻草人、杀手蛾和农夫，大件有蝙蝠侠直升飞机，可以打开驾驶舱，还能发生射钉枪；稻草人的收割机带有旋转道具，车后的绿色气体管可拆卸，以及农夫逃跑驾驶的红色拖拉机。随同玩具还配有一本乐高漫画书。适合7岁以上儿童玩耍。注：（二手产品介意勿拍，不退不换）', '1', 'admin', 'admin', '2017-07-10 15:46:27', '2017-07-11 17:30:34', '123.00', null);
