INSERT INTO `product` VALUES ('747', '小泰克百变海洋成长乐园', null, '0', '0', '1', '/uploadFile/product/201707/ebb43c88-7411-45be-a133-d1bf01c48fc3.jpg', '/uploadFile/product/201707/ebb43c88-7411-45be-a133-d1bf01c48fc3.jpg', '122', '124', '适用年龄：6个月以上\n功能：融入海洋的元素，让孩子尽早见到新场景，有助于提升宝宝的好奇心。\n 有效锻炼宝宝的手臂肌肉，潜艇的旋转舱门设置，可以让宝宝在坐立的时候充分动手运 动。\n身体协调能力对宝宝成长很重要，在宝宝爬行时期，是锻炼宝宝四肢协调能力的好时间，是儿童提高智力的好帮手', '1', 'admin', 'admin', '2017-07-13 09:31:27', '2017-07-14 15:04:52', '123.00', null);
