INSERT INTO `product` VALUES ('753', '新佳丰欢乐游乐园（大块轨道）', null, '0', '0', '1', '/uploadFile/product/201707/6478b284-cc36-46ab-9ffa-b4eb1f9f5550.jpg', '/uploadFile/product/201707/6478b284-cc36-46ab-9ffa-b4eb1f9f5550.jpg', '122', '124', '锻炼孩子在视觉、 空间等方面的感知力，并把所有感知的形象以图画或脑图的形式表现出\n来，提升孩子对色彩、线条、形状、空间的敏感度。通过使空间结构关系可视化、观察、记\n录 、分析物体之间的静动态关系，使所有感官功能都均匀地发挥作用，提高孩子动手组装、\n观察分析能力，活跃了宝宝大脑思维 。', '1', 'admin', 'admin', '2017-07-13 10:00:26', '2017-07-14 18:03:44', '123.00', null);
INSERT INTO `product` VALUES ('757', '小泰克折叠厨房', null, '0', '0', '1', '/uploadFile/product/201707/428495b7-d931-4d6e-9fa3-c0867b777176.jpg_/uploadFile/product/201707/dae2b278-8ea7-4c0c-8b6b-1abaca322cec.jpg', '/uploadFile/product/201707/428495b7-d931-4d6e-9fa3-c0867b777176.jpg', '122', '133', '1小厨房，大功能\n功能全，体积小，能折叠携带的厨房诞生了，\n能在家中玩，更能收进车尾箱，带着郊游时玩\n2多配件\n32个配件能让孩子充分发挥想象，开心进行过家家的游戏\n3爱洗手身体好\n带水龙头的洗手盆设计，吸引孩子，培养其在玩耍后爱洗手的习惯\n4一应俱全\n厨房必备的微波炉，烤炉，饮水机，燃气灶等都一应俱全，\n快和小伙伴们一起游戏吧\n5折叠式，更方便\n3折叠式的设计，厨房收起后体积小，\n节省家里收藏空间，完全展开后就是一个现代化的豪华厨房\n6仿真的声音\n炉子的开关在转动时会发出“唁嗒”的声音喔，\n煮的游戏更加真实好玩\n7双层转盘式架子\n一个双层转盘式的调味品架子生让“烹旺”更加万便', '1', 'admin', 'admin', '2017-07-13 10:36:55', '2017-07-14 14:08:29', '123.00', null);
INSERT INTO `product` VALUES ('761', 'EDTOY磁力积木', null, '0', '0', '1', '/uploadFile/product/201707/e584a3a1-5ef6-4966-8b34-b790ae7d79f8.jpg', '/uploadFile/product/201707/e584a3a1-5ef6-4966-8b34-b790ae7d79f8.jpg', '122', '124', '使用年龄：3岁以上\n边玩边学的教学用具：孩子们用它可以做出多样的模型，在不知不觉中学到东西；\n引发很多创意的教学用具：通过对三角形、四角形、圆形的基础图形的认知。能开发孩子们的形态感，并能开发孩子们的想象力和表现力，问题解决能力、\n训练逻辑能力的教学用具：通过对小肌肉调节能力的提高，能锻炼运动技术，并通过手动的运动能刺激左脑和右脑并得到锻炼。\n360度旋转磁铁：随便分离，组合在一起时会发出清脆的响声，刺激孩子的听力', '1', 'admin', 'admin', '2017-07-13 11:04:12', '2017-07-14 13:51:36', '123.00', null);
INSERT INTO `product` VALUES ('762', 'Bright Starts 三合一婴儿活动乐园', null, '0', '0', '1', '/uploadFile/product/201707/012408e3-338a-4c34-b6d6-270dd0db7041.jpg', '/uploadFile/product/201707/012408e3-338a-4c34-b6d6-270dd0db7041.jpg', '122', '124', '【产品尺寸】86*71*61cm\n它采用了创新的360度座椅，能让宝宝访问所有的玩具和活动。\n \n桌上所有的玩具：\n          电子钢琴和FLIP书，包含三种模式：儿歌，钢琴音乐和逗乐的声音。\n          驱逐舰，弹出玩具，活动的蜻蜓和游动的小鱼。\n          旋转珠子，大镜子和青蛙玩具\n          齿轮玩具，旋转球，和可弯曲的牙胶。', '1', 'admin', 'admin', '2017-07-13 11:10:34', '2017-07-14 13:40:24', '123.00', null);
