INSERT INTO `product` VALUES ('777', '爱升婴童汽车帐篷', null, '0', '0', '1', '/uploadFile/product/201707/55142af7-0a1e-4372-bf51-a2bc312da297.jpg', '/uploadFile/product/201707/55142af7-0a1e-4372-bf51-a2bc312da297.jpg', '122', '124', '爱升婴童汽车帐篷：100%全面帆布，质感厚实，不容易气球，没有气味，布料可以随意抽出清洗。活性印染不添加对人体有害化学物，十分环保很健康，经过活性印染的面料，色牢度好常洗不褪色。全新工艺制作，预缩水处理，水洗不易缩水。选用优质的铁杆，表面附有环保漆，表面光滑，无气味，手感好，不蛀虫·轻便·不易断。采用精致双线缝纫，结实牢固，不易漏线。', '1', 'admin', 'admin', '2017-07-13 13:44:35', '2017-07-13 23:38:42', '123.00', null);
INSERT INTO `product` VALUES ('779', '大型摩托沙滩摩托', null, '0', '0', '1', '/uploadFile/product/201707/e68d4d49-9979-4ad4-b1bf-339d0b26749f.jpg', '/uploadFile/product/201707/e68d4d49-9979-4ad4-b1bf-339d0b26749f.jpg', '122', '124', '大型摩托沙滩摩托：带防打滑圈轮胎：防打滑圈设计，使车车在行驶过程中抓地更稳，更牢！不易打滑！仿真避震：此车造型逼真，仿真避震设计让车车看起来更靓丽!高低速及前后进开关：高低速开关可以随心掌握速度前后进可以让车·车轻松掌握方向！脚踏控制板，让宝宝对车可以轻松掌控，僧加驾驶乐趣！后尾带盖充电口：充电口在尾部，家长充电很方便带盖充电口设计，让宝宝也不容易触摸！也可以防灰尘，充电放便且安全！', '1', 'admin', 'admin', '2017-07-13 13:47:05', '2017-07-14 00:00:24', '123.00', null);
INSERT INTO `product` VALUES ('781', '儿童小围栏', null, '0', '0', '1', '/uploadFile/product/201707/30d53723-86ad-41dc-be4e-1985a4f1d005.jpg', '/uploadFile/product/201707/30d53723-86ad-41dc-be4e-1985a4f1d005.jpg', '122', '124', '儿童小围栏：质量好到没朋友，没有发现毛刺，安全稳固，宝宝玩的很开心安装方便，宝宝自己的小天地，围栏无气味，颜色漂亮宝宝很喜欢。', '1', 'admin', 'admin', '2017-07-13 13:48:26', '2017-08-02 14:55:09', '123.00', null);
INSERT INTO `product` VALUES ('782', '红思达挖掘机电动车', null, '0', '0', '1', '/uploadFile/product/201707/f9075727-8621-4058-8a0b-c0b3b0b2e6fb.jpg', '/uploadFile/product/201707/f9075727-8621-4058-8a0b-c0b3b0b2e6fb.jpg', '122', '124', '红思达挖掘机电动车：高70cm，宽50cm，总长128cm。多功能挖掘机培养孩子的协调能力：促进四肢发达：双手双腿操作工程车，促进宝宝四肢肌肉发达，健康成长。动作锻炼：不同部位的业绩凹凸质感可以刺激宝宝触觉的发展。手眼协调能力：在操作工程车挖掘动作时，锻炼宝宝手足协调能力。培养创造力：通过宝宝自己的亲身体验，培养宝宝的想象力和创造力。', '1', 'admin', 'admin', '2017-07-13 13:49:50', '2017-07-14 00:21:05', '123.00', null);
INSERT INTO `product` VALUES ('783', '恒泰挖掘机工程车', null, '0', '0', '1', '/uploadFile/product/201707/de67db54-a5f0-4ac9-930a-debff5e03e81.jpg', '/uploadFile/product/201707/de67db54-a5f0-4ac9-930a-debff5e03e81.jpg', '122', '124', '恒泰挖掘机工程车：稳固安全，质量厚实，音乐炫光，大储物箱。多元化机械臂，强力牢固臂杆，可转动驾驶室，音乐生效方向盘，舒适弯弧靠背，', '1', 'admin', 'admin', '2017-07-13 13:50:36', '2017-07-14 00:27:48', '123.00', null);
