INSERT INTO `product` VALUES ('790', '小泰克戏水厨房', null, '0', '0', '1', '/uploadFile/product/201707/a4a536d7-63bc-46da-befe-190f635f3fe8.jpg', '/uploadFile/product/201707/a4a536d7-63bc-46da-befe-190f635f3fe8.jpg', '122', '124', '小泰克戏水厨房：培养孩子动手能力：增加亲子互动的机会粑粑麻麻一起做饭，洗碗，好欢乐！丰富孩子的想象力：让宝宝学会思考，开发思维想象。模拟生活真实场景：角色扮演模拟生活真实场景，提高宝宝的认知能力。视觉训练：手脑眼同时发展的益智玩具。锻炼宝宝的动手能力：让宝宝当一回家，洗洗碗做做饭。外表精致美观：让宝宝在快乐的玩耍中学习·成长。无毒无刺激性气味：可食级环保塑料材质。让宝宝感受色彩：宝宝认识颜色是有一个科学的发展规律的玩具以其生动夸张的形象·鲜艳明亮的色彩刺激幼儿用各种感觉去接触。锻炼宝宝动手动脑能力，增加颜色，厨具认知，宝宝爱做饭，满足宝宝的好奇心。', '1', 'admin', 'admin', '2017-07-13 13:55:34', '2017-07-13 23:18:24', '123.00', null);
INSERT INTO `product` VALUES ('791', '伟易达动物宝船', null, '0', '0', '1', '/uploadFile/product/201707/cdfc84f8-29b9-4b8c-8a95-764f167c4bb2.jpg', '/uploadFile/product/201707/cdfc84f8-29b9-4b8c-8a95-764f167c4bb2.jpg', '122', '124', '“动物宝船”属于伟易达“成长第一步”系列产品中的一款，专为1岁以上幼儿综合能力开发而设计的电子教育产品。动物宝船的学习模式分为中、英双语模式。小朋友可以在这里了解很多小动物，认识形状，学习颜色。轻轻一按船身上的汽笛灯，或者拖拉宝船，小朋友可以听到有趣的短语，动听的音乐和优美的英文儿童歌曲。', '1', 'admin', 'admin', '2017-07-13 13:56:15', '2017-07-13 19:46:53', '123.00', null);
INSERT INTO `product` VALUES ('792', '伟易达变形恐龙棘背龙', null, '0', '0', '1', '/uploadFile/product/201707/491f85bf-d6d6-4ae6-b4bf-c9c27a50f019.jpg', '/uploadFile/product/201707/491f85bf-d6d6-4ae6-b4bf-c9c27a50f019.jpg', '122', '124', '超级变变变\n飞机、棘背龙切换\n通过让宝宝在恐龙形态和汽车形态相互切换过程中锻炼宝宝动手能力。\n\n丰富表情\n无论是变身为恐龙还是玩具车，LCD显示屏都会显示出丰富的表情，恐龙会有多种不同心情的眼睛，玩具车会有多种不同表情和动作的司机。\n\n会说话\n无论在恐龙形态和汽车形态，都会有语音说话，陪宝宝扮演各种角色和教宝宝一些恐龙知识。\n\n激发想象\n变形恐龙家族总共有6为成员，每只不同的恐龙让孩子插上想象的翅膀，充分发挥宝宝的想象力，进行角色扮演。', '1', 'admin', 'admin', '2017-07-13 13:56:49', '2017-07-13 19:39:20', '123.00', null);
INSERT INTO `product` VALUES ('793', '小虎子悍马电动车', null, '0', '0', '1', '/uploadFile/product/201707/ba658d39-c172-4982-8e71-c2e7f0524526.jpg', '/uploadFile/product/201707/ba658d39-c172-4982-8e71-c2e7f0524526.jpg', '122', '124', '创新技术：一键启动、平稳起步（无级变速）、高低速避震减压功能、多功能音乐方向盘、MP3接口、LED彩灯。', '1', 'admin', 'admin', '2017-07-13 13:57:20', '2017-07-13 19:38:16', '123.00', null);
INSERT INTO `product` VALUES ('794', '伟易达字母巴士', null, '0', '0', '1', '/uploadFile/product/201707/a521a67e-ec6d-4980-9f35-53b48b64fd91.jpg', '/uploadFile/product/201707/a521a67e-ec6d-4980-9f35-53b48b64fd91.jpg', '122', '124', '有趣的字母巴士\n英文模式\n按下“出发”按钮主机会欢快的告诉你巴士车下站将到达的地点和播放一些有趣的音效。如：“The next stop is the zoo.”\n中文模式\n按下“出发”按钮，你会知道巴士车下站将要到达的地点和播放一些有趣的音效。如“下一站是动物园。”\n\n\n听音乐\n拖动字母巴士，主机会随机播放一些好听的音效和歌曲。\n\n学习数字、音符\n在字母发音、字母学习和考考你三个游戏模式中\n按数字按钮会听到数字相应的英文读音或中文读音以及有趣的音效。\n在音乐欣赏游戏中\n按数字按钮，主机播放每个数字代表的音符。', '1', 'admin', 'admin', '2017-07-13 13:58:02', '2017-07-14 13:02:54', '123.00', null);
