INSERT INTO `product` VALUES ('1972', '小泰克烹饪餐车厨房', '0191', '0', '2', '0', '/uploadFile/product/201708/c0b8c327-00e1-4010-b760-0022bc6dded6.jpg', '/uploadFile/product/201708/c0b8c327-00e1-4010-b760-0022bc6dded6.jpg', '122', '133', '适用年龄：3-6岁\n可移动餐桌，增加玩乐趣味，发挥孩子的创造天赋，在角色扮演中提高孩子认知度', '0', 'admin', 'admin', '2017-08-21 12:50:51', '2017-08-21 13:35:53', '123.00', null);
INSERT INTO `product` VALUES ('1973', '小泰克户外烧烤炉', '0192', '0', '0', '2', '/uploadFile/product/201708/08d9dcd3-8621-44eb-896f-a24dccb9326a.jpg', '/uploadFile/product/201708/08d9dcd3-8621-44eb-896f-a24dccb9326a.jpg', '122', '133', '满足宝贝不同阶段的成长需求，训练宝宝视觉，听觉，触觉，手眼协调能力，让宝宝在玩耍过程中识别事物，形状，颜色等多种生活常识', '0', 'admin', 'admin', '2017-08-21 12:54:09', '2017-08-21 13:29:27', '123.00', null);
INSERT INTO `product` VALUES ('1974', 'step2舒适小厨房', '0193', '0', '0', '1', '/uploadFile/product/201708/6b1a52e1-9e71-48f2-9573-42175929e3e3.jpg', '/uploadFile/product/201708/6b1a52e1-9e71-48f2-9573-42175929e3e3.jpg', '122', '133', '这款厨房设计紧凑，包含了现代厨房的所有功能！让你的小厨师在里面大展身手吧！多功能橱柜加上烤箱和冰箱提供了充足的存储空间，方便清理。大量的仿真厨具，包括可旋转水龙头的水槽、 炉灶、 烤箱和冰箱及其他 10几种配件，，通过玩耍个提高宝宝的动手，识别、和社交能力', '0', 'admin', 'admin', '2017-08-21 12:58:25', '2017-08-21 13:25:48', '123.00', null);
INSERT INTO `product` VALUES ('1975', '小泰克烧烤炉', '0194', '0', '0', '2', '/uploadFile/product/201708/5d5e54ad-b041-47d7-afe6-a8601e4aa19a.jpg', '/uploadFile/product/201708/5d5e54ad-b041-47d7-afe6-a8601e4aa19a.jpg', '122', '133', '功能：\n1、启发儿童的创造力、想像力及对社会的适应能力；\n2、着重儿童身心的均衡发展；\n3、设计新颖突出，既富挑战性；\n4、色彩鲜艳、适用于各种气候环境、耐紫外线照射、颜色持久不褪；\n5、产品保证安全、耐用可靠、使用寿命长', '0', 'admin', 'admin', '2017-08-21 13:03:22', '2017-08-21 13:20:05', '123.00', null);
INSERT INTO `product` VALUES ('1976', '小泰克维修工具台', '0195', '0', '0', '3', '/uploadFile/product/201708/dea6d998-2158-468a-b096-155ebc89394d.jpg', '/uploadFile/product/201708/dea6d998-2158-468a-b096-155ebc89394d.jpg', '122', '125', '适用年龄：2岁以上\n产品尺寸：71.12×35.56×101.6CM\n锤子和“钉子”帮助孩子发展手眼协调能力，锻炼大脑，增强手脑灵活性', '0', 'admin', 'admin', '2017-08-21 13:19:37', '2017-08-21 15:54:37', '123.00', null);
